import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import AddLocationRoundedIcon from '@material-ui/icons/AddLocationRounded';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="#">
        Covid Watch
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },

  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },

  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },

  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));
export default function State_Search(props) {
  const handleChange = (e) => {
     props.handleSearch(e.target.value)
   };

  const classes = useStyles();

  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
        <Avatar className={classes.avatar}>
          <AddLocationRoundedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          Login
        </Typography>
        <form className={classes.form} noValidate>
            <InputLabel id="demo-simple-select-label">Age</InputLabel>
                <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    value={props.state}
                    onChange={handleChange}
                    >
                    <MenuItem value={'Al'}>Alaska</MenuItem>
                    <MenuItem value={'AK'}>Twenty</MenuItem>
                    <MenuItem value={'AZ'}>Twenty</MenuItem>
                    <MenuItem value={'AR'}>Twenty</MenuItem>
                    <MenuItem value={'CA'}>Thirty</MenuItem>
                    <MenuItem value={'CO'}>Ten</MenuItem>
                    <MenuItem value={'CT'}>Twenty</MenuItem>
                    <MenuItem value={'DE'}>Ten</MenuItem>
                    <MenuItem value={'FL'}>Twenty</MenuItem>
                    <MenuItem value={'GA'}>Thirty</MenuItem>
                    <MenuItem value={'HI'}>Ten</MenuItem>
                    <MenuItem value={'ID'}>Twenty</MenuItem>
                    <MenuItem value={'IL'}>Alaska</MenuItem>
                    <MenuItem value={'IN'}>Twenty</MenuItem>
                    <MenuItem value={'IA'}>Thirty</MenuItem>
                    <MenuItem value={'KS'}>Ten</MenuItem>
                    <MenuItem value={'KY'}>Twenty</MenuItem>
                    <MenuItem value={'LA'}>Ten</MenuItem>
                    <MenuItem value={'ME'}>Twenty</MenuItem>
                    <MenuItem value={'MD'}>Thirty</MenuItem>
                    <MenuItem value={'MA'}>Ten</MenuItem>
                    <MenuItem value={"MI"}>Twenty</MenuItem>
                    <MenuItem value={'MN'}>Alaska</MenuItem>
                    <MenuItem value={'MS'}>Twenty</MenuItem>
                    <MenuItem value={'MO'}>Thirty</MenuItem>
                    <MenuItem value={'MT'}>Ten</MenuItem>
                    <MenuItem value={'NE'}>Twenty</MenuItem>
                    <MenuItem value={'NV'}>Ten</MenuItem>
                    <MenuItem value={'NH'}>Twenty</MenuItem>
                    <MenuItem value={'NJ'}>Thirty</MenuItem>
                    <MenuItem value={'NM'}>Ten</MenuItem>
                    <MenuItem value={"NY"}>Twenty</MenuItem>
                    <MenuItem value={'NC'}>Alaska</MenuItem>
                    <MenuItem value={'ND'}>Twenty</MenuItem>
                    <MenuItem value={'OH'}>Thirty</MenuItem>
                    <MenuItem value={'OK'}>Ten</MenuItem>
                    <MenuItem value={'OR'}>Twenty</MenuItem>
                    <MenuItem value={'PA'}>Ten</MenuItem>
                    <MenuItem value={'RI'}>Twenty</MenuItem>
                    <MenuItem value={'SC'}>Thirty</MenuItem>
                    <MenuItem value={'SD'}>Ten</MenuItem>
                    <MenuItem value={"TN"}>Twenty</MenuItem>
                    <MenuItem value={'TX'}>Alaska</MenuItem>
                    <MenuItem value={'UT'}>Twenty</MenuItem>
                    <MenuItem value={'VT'}>Thirty</MenuItem>
                    <MenuItem value={'VA'}>Ten</MenuItem>
                    <MenuItem value={'WA'}>Twenty</MenuItem>
                    <MenuItem value={'WV'}>Ten</MenuItem>
                    <MenuItem value={'WI'}>Twenty</MenuItem>
                    <MenuItem value={'WY'}>Thirty</MenuItem>
                    </Select>
        </form>
      </div>

      <Box mt={8}>
        <Copyright />
      </Box>
    </Container>
  );
}
